import React from 'react';

function EnvironmentSelectionPage({ setEnvironment }) {
  const handleEnvironmentSelection = (environment) => {
    setEnvironment(environment);
  };

  return (
    <div>
      <h1>Select Environment</h1>
      <button onClick={() => handleEnvironmentSelection('BF1')}>Development</button>
      <button onClick={() => handleEnvironmentSelection('BF2')}>Testing</button>
      <button onClick={() => handleEnvironmentSelection('BF3')}>Staging</button>
      <button onClick={() => handleEnvironmentSelection('BF4')}>Production</button>
    </div>
  );
}

export default EnvironmentSelectionPage;
